CREATE DEFINER=`root`@`%` PROCEDURE `create_nba_player`(
    IN player_id INT,
    IN first_name VARCHAR(50),
    IN last_name VARCHAR(50),
    IN birth_date DATE,
    IN height DECIMAL(4,2),
    IN position VARCHAR(50),
    IN jersey_number INT,
    IN is_active BOOLEAN,
    IN season_exp INT,
    IN team_id INT,
    IN season_year INT
)
BEGIN
    # Create a handler for error 1452
    DECLARE EXIT HANDLER FOR 1452
    BEGIN
        # Change team id to be -1 if it is null
        SET team_id = -1;
    END;

    DECLARE EXIT HANDLER FOR 1048
    BEGIN
        # Change season year to be -1 if it is null
        SET season_year = -1;
    END;

    # Insert position into the positions table
    # If the position already exists, it will not be inserted
    IF NOT EXISTS (SELECT * FROM positions WHERE position_name = position)
    THEN
        INSERT INTO positions (position_name)
        VALUES (position);
    END IF;

    # Insert the player into the nba_players table
    INSERT INTO nba_players (player_id, first_name, last_name, birth_date, height, jersey_number, is_active, season_exp)
    VALUES (player_id, first_name, last_name, birth_date, height, jersey_number, is_active, season_exp);

    # Insert the player into the player_position_link table
    INSERT INTO player_position_link (player_id, position_id)
    VALUES (player_id, (SELECT position_id FROM positions WHERE position_name = position));

    # Insert the player into the player_team_link table
    INSERT INTO player_team_link (player_id, team_id, season_year)
    VALUES (player_id, team_id, season_year);

END ;;
